import Counter from "./components/Counter";
import { Fragment } from "react";
import Header from "./components/Header";
import UserProfile from "./components/UserProfile";

function App() {
  return (
    <Fragment>
      <Header />
      <UserProfile></UserProfile>
      <Counter />
    </Fragment>
  );
}

export default App;
